import React from "react";
import styles from "./auth.css";

function login() {
	return (
		<>
			<div className={styles.container}>login</div>
			<form>
				<div>
					<label>Email:</label>
					<input type="email" required />
				</div>

				<div>
					<label>Password:</label>
					<input type="password" required />
				</div>
			</form>
		</>
	);
}

export default login;
